import React from 'react';

function Filter({ filters, onFilterChange }) {
  const handleFilterSelect = (filterName, event) => {
    onFilterChange(filterName, event.target.value.toLowerCase()); // Ensure the value is lowercase
  };
  const renderDogFilters = () => {
    return (
      <>
        <div className="filter-group">
          <label htmlFor="size">Size:</label>
          <select
            id="size"
            value={filters.size}
            onChange={(event) => handleFilterSelect('size', event)}
          >
            <option value="any">Any</option>
            <option value="small">Small</option>
            <option value="medium">Medium</option>
            <option value="large">Large</option>
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="breed">Breed:</label>
          <select
            id="breed"
            value={filters.breed}
            onChange={(event) => handleFilterSelect('breed', event)}
          >
            <option value="any">Any</option>
            <option value="breed1">Breed 1</option>
            <option value="breed2">Breed 2</option>
            {/* Add more breed options */}
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="age">Age:</label>
          <select
            id="age"
            value={filters.age}
            onChange={(event) => handleFilterSelect('age', event)}
          >
            <option value="any">Any</option>
            <option value="puppy">Puppy</option>
            <option value="adult">Adult</option>
            <option value="senior">Senior</option>
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="gender">Gender:</label>
          <select
            id="gender"
            value={filters.gender}
            onChange={(event) => handleFilterSelect('gender', event)}
          >
            <option value="any">Any</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="shelter">Shelter:</label>
          <select
            id="shelter"
            value={filters.shelter}
            onChange={(event) => handleFilterSelect('shelter', event)}
          >
            <option value="any">Any</option>
            <option value="shelter1">Shelter 1</option>
            <option value="shelter2">Shelter 2</option>
            {/* Add more shelter options */}
          </select>
        </div>
        {/* Add dog-specific filters here */}
      </>
    );
  };

  const renderCatFilters = () => {
    return (
      <>
        <div className="filter-group">
          <label htmlFor="breed">Breed:</label>
          <select
            id="breed"
            value={filters.breed}
            onChange={(event) => handleFilterSelect('breed', event)}
          >
            <option value="any">Any</option>
            <option value="catBreed1">Cat Breed 1</option>
            <option value="catBreed2">Cat Breed 2</option>
            {/* Add more cat breed options */}
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="age">Age:</label>
          <select
            id="age"
            value={filters.age}
            onChange={(event) => handleFilterSelect('age', event)}
          >
            <option value="any">Any</option>
            <option value="kitten">Kitten</option>
            <option value="adult">Adult</option>
            <option value="senior">Senior</option>
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="size">Size:</label>
          <select
            id="size"
            value={filters.size}
            onChange={(event) => handleFilterSelect('size', event)}
          >
            <option value="any">Any</option>
            <option value="small">Small</option>
            <option value="medium">Medium</option>
            <option value="large">Large</option>
          </select>
        </div>
        <div className="filter-group">
          <label htmlFor="gender">Gender:</label>
          <select
            id="gender"
            value={filters.gender}
            onChange={(event) => handleFilterSelect('gender', event)}
          >
            <option value="any">Any</option>
            <option value="female">Female</option>
            <option value="male">Male</option>
          </select>
        </div>
        {/* Add more cat-specific filters here */}
      </>
    );
  };
  return (
    <div className="filters">
      <h2>Filters</h2>
      <div className="filter-group">
        <label htmlFor="petType">Pet Type:</label>
        <select
          id="petType"
          value={filters.petType}
          onChange={(event) => handleFilterSelect('petType', event)}
        >
          <option value="any">Any</option>
          <option value="dog">Dog</option>
          <option value="cat">Cat</option>
          <option value="others">Others</option>
        </select>
      </div>
      {(filters.petType === 'cat' || filters.petType === 'any') && renderCatFilters()}
      {(filters.petType === 'dog' || filters.petType === 'any') && renderDogFilters()}
    </div>
  );
}

export default Filter;
